import React, { Component } from "react";
import { Grid } from "semantic-ui-react";

class Leader extends Component {
  state = {};
  render() {
    return (
      <Grid.Row>
          {this.props.game.user.username} - {this.props.game.score}
      </Grid.Row>

    );
  }
}

export default Leader;
